INSERT INTO `Help` VALUES (1,'paths','#dropdown_cv_bttn','left','bottom',1,'CV','Select the conversion goal to apply to your report.','CV(コンバージョン)選択','解析対象のコンバージョンを選択して下さい。'),(2,'paths','#dropdown_usersegment_bttn','left','bottom',1,'User Segment','Select the user segment to apply to your report.','セグメント選択','設定してあるユーザーセグメントを選択することで、全ての集計結果を特定のユーザーセグメントに絞り込むことができます。複数のセグメント設定を一つのグループにまとめることで、セグメント毎の集計結果の比較をやりやすくできます。'),(3,'paths','#dropdown_cache_bttn','left','bottom',1,'Data','Select the data subset from the overall project data set.','キャッシュリスト','カスタマージャーニーのデータセットをキャッシュリストから選択して下さい。'),(4,'paths','ess-loaded-data-view','left','bottom',1,'Project Data Summary','Click here to view summary statistics on the aggregated project data.','ログサマリー','読み込んだログの総数とユニークユーザー数です。それぞれをコンバージョンしたユーザーと指定対象のセグメントのユーザー別の数も表示します。さらに広告ログとサイトログ別に集計結果を表示します。'),(5,'paths','.tabbutton_path_global_summary','left','top',1,'Stats & Trends','View statistical and trend reports for your project.','基本分析','基本分析'),(6,'paths','.summ-appselection-summ','right','side',1,'Summary','Summary report of total conversions and component contributions.','概要','初回接触からコンバージョンまでの経路に関する概要集計結果です。概要、上段ではCVカウント、及び、CVするまでのパスの長さの概要が表示されております。下段では、それぞれのCVユーザーのパス内にインタラクションタイプが含まれる割合をパイチャートで確認できます。'),(7,'paths','.summ-appselection-logCountTrend','right','side',1,'Trends','Examine trends over time for events and users.','トレンド','トラフィックの履歴です。分、時間、日次、週次、曜日、時間帯、などの多様な集計軸でトレンドをみることができます。\"毎分/毎時/日毎/週毎/月毎/時間帯別/曜日別\"からご覧頂けます。'),(8,'paths','.summ-appselection-logCountTrendMultiUser','right','side',1,'Comparison Trends','View and compare trends between user segments.','比較トレンド','トレンドを指定グループ内の複数のセグメント別に比較することが出来ます。\r'),(9,'paths','.summ-appselection-distFreq','right','side',1,'Frequency Dist','Examine the conversion distributions by days, events, impressions, etc.','頻度分布','初回接触から初回CVまでの間の日数・イベント・インプ・クリックなどの様々な頻度分布が表示されます。UU数および累積率でご覧頂けます。'),(10,'paths','.summ-appselection-distFreqPV','right','side',1,'CV & CV Rate','Examine conversion and non-conversion statistics.','CV数とCVR','CVするまでのイベント数別にCVしたユーザー数の分布を表示します。コンバージョンしていないユーザー数とCVR（コンバージョン率）も重ねて表示します。'),(11,'paths','.summ-appselection-pieBrowsers','right','side',1,'Device Summary','View summary chart of devices used by unique user.','デバイス内訳','利用されているデバイスの内訳を表示します。\r'),(12,'paths','.summ-appselection-beforeAfterTable','right','side',1,'Before/After CV','Examine the number and rate of interactions before and after conversions.','CV前後比較','イベント数をCVの前後で比較してご覧になれます。\"CV前率/CV後率\"ではイベント総数に対する割合を表示しております。'),(13,'paths','.summ-appselection-detailTableEventCount','right','side',1,'Ranking','Ranking report of various criteria including page, IP, search key, etc.','ランキング','広告ログとサイトログ別に、キャンペーンやドメインなどの色々な集計キー毎にイベント数とUU数のランキングを表示します。トップ20以降はCSVダウンロード下さい。'),(14,'paths','.summ-appselection-detailTableEntry','right','side',1,'Entry','Drilldown of entry statistics.','流入解析','サイトへの流入経路の集計結果です（広告ログは含めません）。UU数の多い順にランキングを表示します。各流入経路毎にさらに詳細なドリルダウンもできます。20位以降はCSVダウンロードをご利用下さい。'),(15,'paths','.summ-appselection-detailTableRegionMap','right','side',1,'By Region','Examine unique users segmented by geographic region.','地域','ユーザーのアクセス元都道府県の集計結果です。'),(16,'paths','.summ-appselection-attrScore','right','side',1,'Attribution Score','View attribution scoring report.  Evaluate different models.','アトリビューションスコア','10種類の異なるモデルでのアトリビューションスコアを表示します。csvダウンロードで全件ご利用頂けます。またコストデータをアップロードすることでCPAとしてもご覧になれます。アップロードするコストデータはcsv形式で、1カラム目にキャンペーン名などのラベルを2カラム目に費用数値をご記入下さい。'),(17,'paths','.summ-appselection-attrScoreFMD','right','side',1,'FML Table','Drilldown of first, middle and last interaction events.','F-M-Lテーブル','初回接触でのイベント数(First)、CV直前のイベント数(Last)、それ以外でのイベント数(Middle)としてそれぞれカウントしております。'),(18,'paths','.tabbutton_path_cj_paths','left','top',1,'Customer Journeys','View the list of customer journey paths in descending order.','CJパス','ユーザーの行動パターンを可視化します。着目したいイベントや複数のイベントをグルーピングする設定を複数登録しておき、それらを選択することで様々な視点で行動パターンを可視化できます。全てのユーザーの全てのパスを集計しCVしたUU数の多いパターン順に10件ずつ表示されます。'),(19,'paths','#dropdown_cjpath_detailconfig_bttn','left','top',1,'Path Configuration','Select the number of touchpoints to display, path direction and endpoints.','パスの始点と方向','First : 初回接触から時間順に行動パターンを表示します。全てのユーザーの全てのパスパターンを表示します。Last : 初回CVを起点にし時間を逆方向に指定の深さまで集計し発生時間順に表示します。この場合CVしたユーザーだけが対象になります。初回接触から順にご覧になるか、初回CVまでご覧になるかをご選択下さい。'),(21,'paths','#dropdown_cjpath_grouping_bttn','left','top',1,'Touchpoint Configuration','Select the user-defined touchpoint filter settings.','パス構成条件','現在設定されているパスの構成条件（着目したい行動イベントやそれぞれの表現など）の詳細を表示します。パスの構成条件の追加や編集には管理者権限が必要です。\r'),(24,'paths','.helper-keyword-search','left','side',1,'Search Box','Enter search keywords to filter for specific customer journey paths.','検索ボックス','指定キーワードを含むパスだけに絞り込むことができます。スペース区切りで複数ワードを入れるとor検索が出来ます。'),(26,'paths','.path_dl_csv','right','bottom',0,'path download','Download all path results.','ダウンロード','全てのパスパターンをダウンロードできます。\r'),(27,'paths','.path_detail_open_sample','left','bottom',0,'sample viewer','This sample viewer is a one user log who is randomly picked up from people who took the path.','サンプル','該当のパスのユーザーのうち1人のログ全件をサンプルとして表示します。（CVユーザーを優先的に表示）\r'),(28,'paths','.path_detail_dl_csv','left','bottom',0,'log download','Download all logs of people who took the path.','ログダウンロード','該当パスパターンを持つ全ユーザーのログをダウンロードできます。\r'),(29,'paths','.path_detail_open_popup','left','bottom',0,'popup detail','It will popup the detail analysis panel.','ドリルダウン','該当パスのパターンを持つユーザーセグメントに絞り、詳細集計を行うことができます。\r');
